<p>支持Hexo的评论系统，太多了，不免让人眼花缭乱，由于鄙人博客部署的是自己的服务器，和git基本无关联，所以我就优先考虑了<a href="https://valine.js.org/" target="_blank" rel="noopener noreferrer">Valine</a>。Valine方便，简单，本文也是以valine为例子进行说明。如果，你的博客是部署再github，也可以采用gitment之类的评论系统。大家可以参考以下知乎的<a href="https://www.zhihu.com/question/267598518" target="_blank" rel="noopener noreferrer">Hexo（NexT 主题）评论系统哪个好</a>这个话题，</p>
