<p>最近在做前端监控项目时，遇到了关于前端数据上报方式的相关问题。故在此做一个分析和探讨，来比较和分析一下哪种上报方式时最优的，或者说，哪一种上报方式更适合自身，适合当前的业务。我认为，抛开实际使用场景谈孰优孰劣就是耍流氓。凡是都要实事求是，一切从实际出发，才能找出最优解。</p>
